import{_ as a,a as r,b as e,c as t,d as l,e as o,f as i}from"./chunks/qgc_set_usavcan_sub_bat.C6xi6Ob5.js";import{_ as n,c as s,o as c,ab as p}from"./chunks/framework.CUflZczI.js";const b=JSON.parse('{"title":"CAUV CAN PMU","description":"","frontmatter":{},"headers":[],"relativePath":"uk/dronecan/cuav_can_pmu.md","filePath":"uk/dronecan/cuav_can_pmu.md"}'),h={name:"uk/dronecan/cuav_can_pmu.md"},_=p('<h1 id="cauv-can-pmu" tabindex="-1">CAUV CAN PMU <a class="header-anchor" href="#cauv-can-pmu" aria-label="Permalink to &quot;CAUV CAN PMU&quot;">​</a></h1><p>CAN PMU<sup>®</sup> - це високоточний модуль живлення <a href="./">DroneCAN</a>, розроблений компанією CUAV<sup>®</sup>. Він використовує алгоритм компенсації CUAV ITT, який дозволяє дронам отримувати більш точні дані про заряд батареї.</p><p><img src="'+a+'" alt="CAN PMU"></p><p>Рекомендується для використання у великих комерційних транспортних засобах, але також може застосовуватися для дослідницьких транспортних засобів.</p><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><ul><li><a href="https://store.cuav.net/index.php" target="_blank" rel="noreferrer">CUAV store</a></li><li><a href="https://www.aliexpress.com/item/4000369700535.html" target="_blank" rel="noreferrer">CUAV aliexpress </a></li></ul><h2 id="характеристики-обладнання" tabindex="-1">Характеристики обладнання <a class="header-anchor" href="#характеристики-обладнання" aria-label="Permalink to &quot;Характеристики обладнання&quot;">​</a></h2><ul><li><strong>Процесор:</strong> STM32F412</li><li><strong>Вхідна напруга</strong>: 6~62V(2-15S)</li><li><strong>Максимальний струм:</strong> 110A</li><li><strong>Точність напруги:</strong> ±0.05V</li><li><strong>Точність струму:</strong> ±0.1A</li><li><strong>Роздільна здатність:</strong> 0.01A/V</li><li><strong>Максимальна вихідна потужність:</strong> 6000W/90S</li><li><strong>Максимальна стабільна потужність:</strong> 5000W</li><li><strong>Вихід порту живлення:</strong> 5.4V/5A</li><li><strong>Робоча температура:</strong> -20~+100</li><li><strong>Оновлення прошивки:</strong> Підтримується.</li><li><strong>Калібрування:</strong> не потрібно.</li><li><strong>Тип інтерфейсу:</strong><ul><li><strong>IN/OUT:</strong> XT90(Кабель）/Amass 8.0(Модуль）</li><li><strong>Порт живлення:</strong> 5025850670</li><li><strong>CAN:</strong> GHR-04V-S</li></ul></li><li><strong>Зовнішній вигляд:</strong><ul><li><strong>Розмір:</strong> 46.5мм * 38.5мм * 22.5мм</li><li><strong>Вага:</strong> 76g</li></ul></li></ul><h2 id="встановлення-обладнання" tabindex="-1">Встановлення обладнання <a class="header-anchor" href="#встановлення-обладнання" aria-label="Permalink to &quot;Встановлення обладнання&quot;">​</a></h2><h3 id="вміст-набору" tabindex="-1">Вміст набору <a class="header-anchor" href="#вміст-набору" aria-label="Permalink to &quot;Вміст набору&quot;">​</a></h3><p><img src="'+r+'" alt="CAN PMU list"></p><h3 id="розпіновка" tabindex="-1">Розпіновка <a class="header-anchor" href="#розпіновка" aria-label="Permalink to &quot;Розпіновка&quot;">​</a></h3><p><img src="'+e+'" alt="CAN PMU"></p><p><img src="'+t+'" alt="CAN PMU"></p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p><img src="'+l+'" alt="CAN PMU"></p><p>Кроки підключення:</p><ul><li>Підключіть керування польотом CAN1/2 та інтерфейс CAN модуля.</li><li>Підключіть кабель живлення серії V5 до живлення керування польотом V5 Power2 (якщо інші керуючі пристрої підключені до інтерфейсу живлення) та інтерфейсу живлення модуля.</li></ul><h2 id="налаштування-польотного-контролера" tabindex="-1">Налаштування польотного контролера <a class="header-anchor" href="#налаштування-польотного-контролера" aria-label="Permalink to &quot;Налаштування польотного контролера&quot;">​</a></h2><p>Встановіть такі параметри у <em>QGroundControl</em> <a href="./../advanced_config/parameters.html">Vehicle Setup &gt; Parameters</a>, а потім перезапустіть:</p><ul><li><p><a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a>: встановить на: <em>Sensors Automatic Config</em></p><p><img src="'+o+'" alt="qgc set"></p></li><li><p><a href="./../advanced_config/parameter_reference.html#UAVCAN_SUB_BAT">UAVCAN_SUB_BAT</a>: встановить на: <em>Raw data</em></p><p><img src="'+i+'" alt="QGC - Set UAVCAN_SUB_BAT parameter to raw data"></p></li></ul><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><p><a href="http://manual.cuav.net/power-module/CAN-PMU.pdf" target="_blank" rel="noreferrer">Керівництво користувача CAN PMU</a></p><p><a href="http://doc.cuav.net/power-module/can-pmu/en/" target="_blank" rel="noreferrer">Модуль виявлення живлення CAN PMU &gt; Увімкніть CAN PMU &gt; Прошивка PX4</a> (документи CUAV)</p>',24),u=[_];function m(g,d,A,f,C,U){return c(),s("div",null,u)}const V=n(h,[["render",m]]);export{b as __pageData,V as default};
